import React from "react";
import {Col} from 'react-grid-system'
class Temp extends React.Component {
  render() {
    return (
      <div className="temp">
        <Col>
          <img src={require("./images/dcoloaddesktop.gif")} />
        </Col>
      </div>
    );
  }
}

export default Temp;
